import React, { Component } from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Calendar from './Pages/Calendar'
import Landing from './Pages/Landing'
import DropdownMultiple from './Pages/Components/DropdownMultiple'
import Details from './Pages/Details'
import CreateEventForm from './Pages/CreateEventForm'

import './App.css';

let imgUrl = 'homepage_background.png';

var sectionStyle = {
  width: "100%",
  height: "400px",
  backgroundImage: 'url(' + imgUrl + ')',
  backgroundSize: 'cover',
  backgroundPosition: 'center center',
  backgroundRepeat: 'no-repeat',
};

class App extends Component {

  render() {
    return (

      <Router>
        <Switch>
        <Route exact={true} path='/' render={() => (
          <div className="App">
            <div className="Jumbotron">
            </div>
            <Landing />
          </div>
        )} />
          <Route exact={true} path='/calendar' render={() => (
            <div className="App">
              <div className="Jumbotron">
                <h2>WhatsRoaring</h2>
                <h5>Here's what's roaring around Princeton.</h5>
              </div>
              <br>

              </br>

              <Calendar />
            </div>
          )} />
          <Route exact={true} path='/details' render={() => (
            <div className="App">
              <div className="Jumbotron">
                <h2>WhatsRoaring</h2>
              </div>
              <Details />
            </div>
          )} />
          <Route exact={true} path='/submitEvent' render={() => (
            <div className="App">
              <div className="Jumbotron">
                <h2>WhatsRoaring</h2>
              </div>
              <CreateEventForm />
            </div>
          )} />
        </Switch>
      </Router>

    );
  }
}

export default App;
